import React from "react";
import { Row } from "react-bootstrap";
import { useDispatch } from "react-redux";

export const LojaOrdenar = () => {
  let dispatch = useDispatch();
  let ordens = [
    { name: "A-Z", value: "nomeAZ" },
    { name: "Z-A", value: "nomeZA" },
    { name: "Preco (cresente)", value: "precoCrescente" },
    { name: "Preco (decrescente)", value: "precoDecresente" },
  ];
  return (
    <Row
      key={index}
      style={{ overflowY: "none", maxHeight: "660px" }}
      className="justify-content-center align-content-start"
    >
      {ordens.map((ordem, index) => {
        return (
          <button
            onClick={() => {
              dispatch(SetOrdem(ordem.value));
            }}
            className="buttonOrdem"
          >
            {ordem.name}
          </button>
        );
      })}
    </Row>
  );
};
